script: |
  super -f text -I q3399.spq | sort > q3399.out

inputs:
  - name: q3399.spq
    data: |
      SELECT DISTINCT - col2 AS col1 FROM tab2 (FORMAT parquet) WHERE NOT NULL NOT IN ( - 34, col0, + col0 * - col2, col1, 22 * + col1 + - col2 );
  - name: tab2

outputs:
  - name: q3399.out
    data: |
